import React from 'react'

const Home = (props) => {
   
    return (
        <>
            <div className="row">
                <div className="card">
                    <h1>{props.title}</h1>
                    <h3>{props.subtitle}</h3>
                <img src={props.imgsrc}/>
            </div>
            </div>

            
        </>
    )
}
export default Home;
